import React from 'react';
import Navbar from './Navbar';
import MyGallery from './Card';
import "semantic-ui-css/semantic.min.css";
import { Grid, Image } from 'semantic-ui-react';
import './style/App.css';
import ios_bnt from './img/ios_download_btn.png';
export default class Home extends React.Component {
    render(){
       return(
            <div>
               <Navbar />  
               <Grid centered>
               <Grid.Row>
                    <Grid.Column mobile={16} tablet={8} computer={7}>
                        <div className="parent1">
                            <MyGallery/>
                        </div>
                    </Grid.Column>
                    <Grid.Column  mobile={1} tablet={1} computer={2}>

                    </Grid.Column>
                    <Grid.Column mobile={16} tablet={8} computer={5} className="intro">
                        <div style={{textAlignVertical: "center",textAlign: "center",}}>Connecting Chinese with map</div>
                        <div><img style={{width:"50px"}} src={ios_bnt} alt="Logo" /></div>
                    </Grid.Column>

               </Grid.Row>

               </Grid>


            </div>
       )
    }
 }
